import {BrowserRouter} from "react-router-dom";
import Router from "./components/Router";
import NavBar from "./components/NavBar";
import {useSelector} from "react-redux";

function App() {
    const {user} = useSelector(state => state.user);

  return (
      <BrowserRouter>
          <NavBar />
          <Router />
      </BrowserRouter>
  );
}

export default App;
